/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 600px;
    height: 300px;
    display: flex;
    gap: 15px;
    border: 2px solid #333;
    padding: 10px;
}
.item {
    flex: 1;
    padding: 10px;
    box-sizing: border-box;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
}
.nested-flex {
    display: flex;
    flex-direction: column;
    gap: 8px;
    height: 100%;
}
.nested-item {
    flex: 1;
    padding: 8px;
    background-color: #e9ecef;
    border: 1px solid #adb5bd;
    text-align: center;
    font-size: 12px;
}
.horizontal-flex {
    display: flex;
    gap: 5px;
}
.horizontal-item {
    flex: 1;
    padding: 6px;
    background-color: #fff3cd;
    border: 1px solid #ffeaa7;
    font-size: 11px;
    text-align: center;
}
h5 {
    margin-bottom: 8px;
    font-size: 13px;
    color: #495057;
}
